import React from 'react'
import { GU } from '@1hive/1hive-ui'
import WalletCard from './WalletCard'

function AssetList() {
  return (
    <div
      css={`
        display: flex;
        flex-direction: column;
        padding: ${2 * GU}px;
      `}
    >
      <div
        css={`
          display: flex;
          flex-direction: row;
          justify-content: space-around;
        `}
      >
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
      </div>
      <div
        css={`
          display: flex;
          flex-direction: row;
          justify-content: space-around;
        `}
      >
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
        <WalletCard title="test" value="123" />
      </div>
    </div>
  )
}

export default AssetList
